import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button } from 'reactstrap';

function App() {
  return (
    <div className="App">
      <Button>
        Dale
      </Button>
      <Button color="primary">
        Dale
      </Button>
      <Button color="danger">
        Dale
      </Button>
    </div>
  );
}

export default App;
